  }
  return (
    <>
      <div style={{ fontSize: "30px", textAlign: "center", margin: "1%" }}>Task 1 - Kishor Dabi</div>
      <div class="my-form bg-dark">
      <div style={{justifyItems: "center", padding: "20px", borderRadius: "20px", backgroundColor: "light-grey"}}>  
        <h1>Login Form</h1>
        <form>
          <div class="mb-3 mt-4">
            <label for="exampleInputEmail1" class="form-label">Email address</label>
            <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
          </div>
          <div class="mb-3 mt-4">
            <label for="exampleInputPassword1" class="form-label">Password</label>
            <input type="password" class="form-control" id="exampleInputPassword1"/>
          </div>
          <button type="submit" onClick={loginFun()} class="btn btn-light mt-3">LOGIN</button>
        </form>
        </div>
        <p class="mt-4">Not a member? <a href="/signup">Signup now</a></p>
      </div>
    </>
  )
};

export default Login;
